// Navbar.js
import React from 'react';
const navigate = useNavigate();




function Navbar2() {
  
  const navigateTodeals = () => {
    // üëáÔ∏è navigate to /deals
    navigate('/Createdeal');
  };
  return (
    <nav>
      <button onClick={navigateTodeals}>Create Deal +</button>
    </nav>
  );
}

export default Navbar2;
